import { LineChart, Line, CartesianGrid, XAxis, YAxis } from 'recharts';
const data = [
    {
      name: '월',
      uv: 2000,
      pv: 2400,
      amt: 2400,
    },
    {
      name: '화',
      uv: 3000,
      pv: 1398,
      amt: 2210,
    },
    {
      name: '수',
      uv: 2000,
      pv: 9800,
      amt: 2290,
    },
    {
      name: '목',
      uv: 2780,
      pv: 3908,
      amt: 2000,
    },
    {
      name: '금',
      uv: 1890,
      pv: 4800,
      amt: 2181,
    },
    {
      name: '토',
      uv: 2390,
      pv: 3800,
      amt: 2500,
    },
    {
      name: '일',
      uv: 3490,
      pv: 4300,
      amt: 2100,
    },
  ];

const renderLineChart = (
  <LineChart width={400} height={400} data={data}>
    <Line type="monotone" dataKey="uv" stroke="#8884d8" />
    <CartesianGrid stroke="#ccc" />
    <XAxis dataKey="name" />
    <YAxis />
  </LineChart>
);

export default renderLineChart;
